export default function Manatee() {
    return (
        <>
            <div className="imgContainer">
                <img
                    className="imgBackground"
                    src="https://picjumbo.com/wp-content/uploads/the-golden-gate-bridge-sunset-1080x720.jpg"
                    alt="display image"
                >
                    <p></p>
                </img>
            </div>
        </>
    );
}
